const ShippingForm =(props)=>{
    const [PackingSLipID ,ShippingDate ,DeliveryDate ,CarrierName ,TrackingNo] = props.shipping;
    return(
        <div>
            <label>Packing Slip ID</label>
            <input value={PackingSLipID}></input>
            <label>Shipping Date</label>
            <input value={ShippingDate}></input>
            <label>Delivery Date</label>
            <input value={DeliveryDate}></input>
            <label>Carrier Name</label>
            <input value={CarrierName}></input>
            <label>Tracking No.</label>
            <input value={TrackingNo}></input>
        </div>
    )
};

export default ShippingForm;
